import { Table, Button } from 'react-bootstrap';
import { excluir, consultarTodos } from '../../../servicos/funcionarioService';
import { useContext, useEffect, useState } from 'react';
import { ContextoUsuarioLogado } from '../../../App';

export default function TabelaFuncionarios(props) {
    const contextoUsuario = useContext(ContextoUsuarioLogado);
    const [funcionarios, setFuncionarios] = useState([]);
    const [carregando, setCarregando] = useState(true); // Adicionando estado de carregamento
    const [erro, setErro] = useState(null); // Adicionando estado de erro

    useEffect(() => {
        carregarFuncionarios();
    }, []);

    function carregarFuncionarios() {
        const token = contextoUsuario?.usuarioLogado?.token;

        if (!token) {
            setErro('Token não encontrado. Faça login novamente.');
            setCarregando(false);
            return;
        }

        setCarregando(true);
        consultarTodos(token)
            .then((dados) => {
                if (Array.isArray(dados)) {
                    setFuncionarios(dados);
                } else {
                    setErro('Resposta inesperada da API.');
                    console.error("Resposta inesperada da API:", dados);
                }
            })
            .catch((erro) => {
                setErro("Erro ao carregar funcionários: " + erro.message);
            })
            .finally(() => {
                setCarregando(false);
            });
    }

    function manipularExclusao(codigo) {
        const token = contextoUsuario?.usuarioLogado?.token;
        if (!token) {
            alert("Token não encontrado. Faça login novamente.");
            return;
        }

        if (window.confirm("Tem certeza que deseja excluir este funcionário?")) {
            excluir(codigo, token)
                .then((resposta) => {
                    alert(resposta.mensagem);
                    if (resposta.status) {
                        carregarFuncionarios(); // Atualiza a lista de funcionários após exclusão
                    }
                })
                .catch((erro) => {
                    alert("Erro ao tentar excluir: " + erro.message);
                });
        }
    }

    function manipularEdicao(funcionario) {
        props.setModoEdicao(true);
        props.setFuncionarioSelecionado(funcionario);
        props.setExibirTabela(false); // Exibe o formulário de edição
    }

    if (carregando) {
        return <p>Carregando funcionários...</p>;
    }

    if (erro) {
        return <p>Erro: {erro}</p>;
    }

    return (
        <Table striped bordered hover>
            <thead>
                <tr>
                    <th>Código</th>
                    <th>Nome</th>
                    <th>Data de Admissão</th>
                    <th>Cargo</th>
                    <th>Departamento</th>
                    <th>Ações</th>
                </tr>
            </thead>
            <tbody>
                {funcionarios.length > 0 ? (
                    funcionarios.map((funcionario) => (
                        <tr key={funcionario.codigo}>
                            <td>{funcionario.codigo}</td>
                            <td>{funcionario.nome}</td>
                            <td>{funcionario.dataAdmissao}</td>
                            <td>{funcionario.cargo}</td>
                            <td>{funcionario.departamento}</td>
                            <td>
                                <Button
                                    variant="warning"
                                    onClick={() => manipularEdicao(funcionario)}
                                    className="me-2"
                                >
                                    Editar
                                </Button>
                                <Button
                                    variant="danger"
                                    onClick={() => manipularExclusao(funcionario.codigo)}
                                >
                                    Excluir
                                </Button>
                            </td>
                        </tr>
                    ))
                ) : (
                    <tr>
                        <td colSpan="6">Nenhum funcionário encontrado.</td>
                    </tr>
                )}
            </tbody>
        </Table>
    );
}
